import React, { Component } from "react";
import "./Work.css";

class Work extends Component {
    render(){
        return (
            <div className="Work">
                <iframe src="https://player.vimeo.com/video/23660736" width="640" height="360" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>
                <p><a href="https://vimeo.com/23660736">Curren$y - #JetsGo (Music Video)</a> from <a href="https://vimeo.com/jetsfoolblog">Jets Fool Blog</a> on <a href="https://vimeo.com">Vimeo</a>.</p>
            </div>
        )
    }
}

export default Work;
